(23, 168, 4055157, 'namecheap', 'Namecheap Inc.', 'namecheap.webp', 'Buy a domain name - Register cheap domain names from $0.99 - Namecheap', 'Founded in 2000, Namecheap is a leading ICANN accredited domain name registrar and web hosting company. Today we have millions of customers worldwide and more than 10 million domains under management. We offer all necessary products to bring people’s ideas online, from domain names, web hosting and SSL certificates, to productivity and marketing apps.', 349, '1', '90% off Namecheap coupons and promo codes', 'Register domain names at Namecheap with discount offer and promo codes.', 'Namecheap, domain, domain name , web hosting, server, servers, mail, e-mail, email, shared hosting, linux hosting, VPS, virtual private server, virtual private servers', '1', '2021-06-02 16:02:09', '2021-06-08 20:27:46'),
